options.template:
{% set columns = [{
        "label": "URL",
        "template": "{{ data.source.url }}",
        "orderField": "url"
    },{
        "label": "Name",
        "template": "{{ data.source.title|default(data.source.url|split('/')|last)|raw }}",
        "orderField": "title.alpha_order"
    },{
        "label": "Description",
        "template": "{{ data.source.description|default('')|raw }}"
    },{
        "label": "Language",
        "template": "{{ data.source.locale|default }}"
    },{
        "label": "First referer label",
        "template": "{{ data.source.referer_label|default }}"
    },{
        "label": "First referer",
        "template": "{{ data.source.referer|default }}"
    },{
        "label": "Type",
        "template": "{{ data.source.mimetype|default|replace({
            'text/html' : 'HTML',
            'application/pdf' : 'PDF',
            'application/zip' : 'ZIP',
        }) }}"
    },{
        "label": "Size",
        "template": "{{ data.source.size|format_bytes }}",
        "orderField": "data.source.size"
    }] %}
    
{% set query = {
    "bool": {
        "must": [
            {
                "term": {
                    "host": {
                        "value": "www.eboxenterprise.be",
                        "boost": 1
                    }
                }
            },
            {
                "terms": {
                    "_contenttype": [
                        "audit"
                    ]
                }
            }
        ]
    }
} %}    
    
